          eiusmod minim laborum. Laboris est elit est exercitation adipisicing.
          Dolore excepteur dolor dolor occaecat ut. Deserunt proident sunt
          aliqua consequat pariatur aliqua nostrud velit.
        </p>
      </div>
    </div>
    </div>
  );
}

export default AboutSection;
